ing pandemic. https://t.co/2hCSrylJh5 https://t.co/tPSZGrGqPz\",\"created_at\":\"2021-06-12T15:08:55.000Z\",\"author_id\":\"558360059\",\"conversation_id\":\"1403731041764872196\"},{\"source\":\"Twitter for iPhone\",\"id\":\"1403706444881403905\",\"entities\":{\"urls\":[{\"start\":100,\"end\":123,\"url\":\"https://t.co/6AUP977SxR\",\"expanded_url\":\"https://www.cdc.gov/vaccines/covid-19/clinical-considerations/myocarditis.html\",\"display_url\":\"cdc.gov/vaccines/covid…\"}]},\"public_metrics\":{\"retweet_count\":73,\"reply_count\":3,\"like_count\":428,\"quote_count\":5},\"lang\":\"ja\",\"possibly_sensitive\":false,\"text\":\"一方で若年男性への mRNA ワクチン接種で全員軽症で回復したものの心筋炎の報告が一般層より多いのは気になります。恐らくこれはワクチンの有害事象として接種後に注意して観察されるべき事例だと思います。 https://t.co/6AUP977SxR\",\"created_at\":\"2021-06-12T13:31:10.000Z\",\"author_id\":\"66294475\",\"conversation_id\":\"1403706444881403905\"},{\"attachments\":{\"media_keys\":[\"3_1403762135335833609\",\"3_1403762201719185408\"]},\"source\":\"Twitter Web App\",\"id\":\"1403762963928989699\",\"entities\":{\"urls\":[{\"start\":242,\"end\":265,\"url\":\"https://t.co/ZsLFwdZx7d\",\"expanded_url\":\"https://covid.cdc.gov/covid-data-tracker/#trends_dailytrendscases\",\"display_url\":\"covid.cdc.gov/covid-data-tra…\"},{\"start\":266,\"end\":289,\"url\":\"https://t.co/E6ZbjliMBy\",\"expanded_url\":\"https://twitter.com/SheilaCreates/status/1403762963928989699/photo/1\",\"display_url\":\"pic.twitter.com/E6ZbjliMBy\"},{\"start\":266,\"end\":289,\"url\":\"https://t.co/E6ZbjliMBy\",\"expanded_url\":\"https://twitter.com/SheilaCreates/status/1403762963928989699/photo/1\",\"display_url\":\"pic.twitter.com/E6ZbjliMBy\"}],\"hashtags\":[{\"start\":36,\"end\":44,\"tag\":\"COVID19\"},{\"start\":117,\"end\":125,\"tag\":\"Florida\"}],\"annotations\":[{\"start\":13,\"end\":14,\"probability\":0.8517,\"type\":\"Place\",\"normalized_text\":\"US\"}],\"mentions\":[{\"start\":4,\"end\":11,\"username\":\"CDCgov\",\"id\":\"146569971\"}]},\"public_metrics\":{\"retweet_count\":2,\"reply_count\":0,\"like_count\":1,\"quote_count\":0},\"lang\":\"en\",\"possibly_sensitive\":false,\"text\":\"Per @CDCgov, US reported 15,160 new #COVID19 cases June 10 (last date updated) and, of those, 2,237 were reported by #Florida. Our 7-day average is low, but going the wrong direction ⬆️.\\n\\nWe're 6% of population and 15% of new cases.\\n\\nSource: https://t.co/ZsLFwdZx7d https://t.co/E6ZbjliMBy\",\"created_at\":\"2021-06-12T17:15:45.000Z\",\"author_id\":\"45268766\",\"conversation_id\":\"1403762963928989699\"},{\"attachments\":{\"media_keys\":[\"3_1403851704291016706\"]},\"source\":\"Twitter for Android\",\"id\":\"1403851707814236160\",\"entities\":{\"urls\":[{\"start\":201,\"end\":224,\"url\":\"https://t.co/6f6onS3L7n\",\"expanded_url\":\"https://www.cdc.gov/vaccines/covid-19/clinical-considerations/myocarditis.html\",\"display_url\":\"cdc.gov/vaccines/covid…\"},{\"start\":225,\"end\":248,\"url\":\"https://t.co/xhUEgunxM7\",\"expanded_url\":\"https://twitter.com/Eduardo_V2017/status/1403851707814236160/photo/1\",\"display_url\":\"pic.twitter.com/xhUEgunxM7\"}],\"annotations\":[{\"start\":72,\"end\":74,\"probability\":0.8628,\"type\":\"Organization\",\"normalized_text\":\"CDC\"}]},\"public_metrics\":{\"retweet_count\":34,\"reply_count\":1,\"like_count\":25,\"quote_count\":0},\"lang\":\"es\",\"possibly_sensitive\":false,\"text\":\"A pesar que saben que la \\\"vacuna\\\" está causando problemas cardiacos, la CDC sigue recomendando que la gente se vacune y con total descaro culpan al sistema inmunológico de los problemas cardiacos.\\uD83E\\uDD26‍♂️\\nhttps://t.co/6f6onS3L7n https://t.co/xhUEgunxM7\",\"created_at\":\"2021-06-12T23:08:24.000Z\",\"author_id\":\"905038609333538820\",\"conversation_id\":\"1403851707814236160\"},{\"source\":\"TweetDeck\",\"id\":\"1403144550571511815\",\"in_reply_to_user_id\":\"1267943824300683270\",\"public_metrics\":{\"retweet_count\":0,\"reply_count\":1,\"like_count\":1,\"quote_count\":0},\"lang\":\"en\",\"entities\":{\"annotat