avirus/20…\"}]},\"public_metrics\":{\"retweet_count\":38,\"reply_count\":10,\"like_count\":103,\"quote_count\":2},\"lang\":\"en\",\"possibly_sensitive\":false,\"text\":\"So basically more than 1/3 of us have had it and recovered.\\nThe fact that this is publicly available but virtually unreported should tell us something.\\nhttps://t.co/pzUVtmbdBv\",\"created_at\":\"2021-06-12T19:24:52.000Z\",\"author_id\":\"47207414\",\"conversation_id\":\"1403795457080401924\"},{\"source\":\"Twitter Web App\",\"id\":\"1403663380234211328\",\"entities\":{\"urls\":[{\"start\":164,\"end\":187,\"url\":\"https://t.co/L10fM5umWi\",\"expanded_url\":\"https://www.cdc.gov/vaccines/COVID-19/clinical-considerations/myocarditis.html\",\"display_url\":\"cdc.gov/vaccines/COVID…\"}]},\"in_reply_to_user_id\":\"1090589722404020224\",\"public_metrics\":{\"retweet_count\":71,\"reply_count\":1,\"like_count\":135,\"quote_count\":0},\"lang\":\"ja\",\"possibly_sensitive\":false,\"text\":\"→CDCは下記のように、ワクチン接種後の心筋炎症例を収集しています。\\nClinical Considerations: Myocarditis and Pericarditis after Receipt of mRNA COVID-19 Vaccines Among Adolescents and Young Adults\\nhttps://t.co/L10fM5umWi\",\"created_at\":\"2021-06-12T10:40:03.000Z\",\"author_id\":\"1090589722404020224\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1403663378946551808\"}],\"conversation_id\":\"1403663376698413059\"},{\"source\":\"Twitter for iPhone\",\"id\":\"1403849816015347713\",\"entities\":{\"urls\":[{\"start\":47,\"end\":70,\"url\":\"https://t.co/cYEfJv4JOL\",\"expanded_url\":\"https://covid.cdc.gov/covid-data-tracker/#vaccination-trends\",\"display_url\":\"covid.cdc.gov/covid-data-tra…\"}],\"annotations\":[{\"start\":41,\"end\":43,\"probability\":0.4594,\"type\":\"Organization\",\"normalized_text\":\"CDC\"}]},\"in_reply_to_user_id\":\"1334281932365029380\",\"public_metrics\":{\"retweet_count\":3,\"reply_count\":0,\"like_count\":8,\"quote_count\":0},\"lang\":\"en\",\"possibly_sensitive\":false,\"text\":\"COVID-19 vaccine statistics