。通常、症状が改善した後、通常の日常生活に戻ることができるが、運動やスポーツへの復帰については、医師に相談する必要あり。\\nhttps://t.co/mylTEa5USM\",\"created_at\":\"2021-06-12T18:56:20.000Z\",\"author_id\":\"467278736\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1403788171121287172\"}],\"conversation_id\":\"1403788171121287172\"},{\"source\":\"Twitter Web App\",\"id\":\"1403790244789440512\",\"entities\":{\"urls\":[{\"start\":131,\"end\":154,\"url\":\"https://t.co/cniFqWFLSU\",\"expanded_url\":\"https://www.cdc.gov/vaccines/COVID-19/clinical-considerations/myocarditis.html\",\"display_url\":\"cdc.gov/vaccines/COVID…\"}]},\"in_reply_to_user_id\":\"467278736\",\"public_metrics\":{\"retweet_count\":17,\"reply_count\":1,\"like_count\":19,\"quote_count\":0},\"lang\":\"ja\",\"possibly_sensitive\":false,\"text\":\"臨床医向け\\n急性の胸痛、息切れ、動悸のある青年や若年成人では心筋炎や心膜炎を考慮し、ワクチン接種歴などを聴取\\n初期評価は、ECG、トロポニン、CRPや赤血球沈降速度等の炎症マーカーを考慮。正常なら心筋炎、心膜炎リスクは低い。\\n疑い例は循環器専門医に相談を検討。\\nhttps://t.co/cniFqWFLSU\",\"created_at\":\"2021-06-12T19:04:10.000Z\",\"author_id\":\"467278736\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1403789880535117833\"}],\"conversation_id\":\"1403788171121287172\"},{\"source\":\"Twitter for iPhone\",\"id\":\"1403814636521099264\",\"entities\":{\"urls\":[{\"start\":165,\"end\":188,\"url\":\"https://t.co/WLMFy3z7DY\",\"expanded_url\":\"https://www.cdc.gov/coronavirus/2019-ncov/cases-updates/burden.html\",\"display_url\":\"cdc.gov/coronavirus/20…\"}],\"annotations\":[{\"start\":24,\"end\":25,\"probability\":0.9479,\"type\":\"Place\",\"normalized_text\":\"US\"}]},\"public_metrics\":{\"retweet_count\":7,\"reply_count\":1,\"like_count\":30,\"quote_count\":0},\"lang\":\"en\",\"possibly_sensitive\":false,\"text\":\"So, basically, half the US has been vaccinated and 1/3 have already had covid. Can we stop pretending we need masks now?  Estimated Disease Burden of COVID-19 | CDC https://t.co/WLMFy3z7DY\",\"created_at\":\"2021-06-12T20:41:05.000Z\",\"author_id\":\"3188871920\",\"conversation_id\":\"1403814636521099264\"},{