xt\":\"ΤΑ ΚΑΝΑΛΙΑ ΣΤΟ ΕΞΩΤΕΡΙΚΟ ΗΔΗ ΑΡΧΙΣΑΝ Ν ΜΙΛΑΝΕ ΓΙΑ ΠΑΝΔΗΜΙΑ ΖΟΜΠΙ....ΡΕ ΝΑ ΔΕΙΣ ΠΟΥ ΟΙ ΕΜΒΟΛΙΑΚΗΔΕΣ ΠΡΟΓΡΑΜΑΤΙΖΟΝΤΑΙ ΓΙΑ ΖΟΜΠΙ!\\uD83E\\uDD23\\uD83D\\uDE02\\uD83E\\uDD23\\uD83E\\uDD23\\uD83E\\uDD23\\nhttps://t.co/dDVIYcXCnm\",\"created_at\":\"2021-06-12T20:52:12.000Z\",\"author_id\":\"1127077114879119360\",\"conversation_id\":\"1403817432180002820\"},{\"source\":\"Twitter Web App\",\"id\":\"1402838003639197697\",\"entities\":{\"urls\":[{\"start\":121,\"end\":144,\"url\":\"https://t.co/FXrRoax0GF\",\"expanded_url\":\"https://www.cdc.gov/vaccinesafety/ensuringsafety/monitoring/cisa/index.html\",\"display_url\":\"cdc.gov/vaccinesafety/…\"}],\"annotations\":[{\"start\":0,\"end\":3,\"probability\":0.4482,\"type\":\"Organization\",\"normalized_text\":\"CISA\"}]},\"in_reply_to_user_id\":\"2401673892\",\"public_metrics\":{\"retweet_count\":324,\"reply_count\":1,\"like_count\":827,\"quote_count\":2},\"lang\":\"ja\",\"possibly_sensitive\":false,\"text\":\"CISAは報告制度ではなく医師同士の相談システム。\\n\\nワクチン接種後の症状について、医師がワクチンの専門家に相談できます。\\n\\nしかし、このシステムに不審な症例の報告が連続してあがってきたら、VAERSやVSDでより詳細な調査が行われます。\\n\\nhttps://t.co/FXrRoax0GF\",\"created_at\":\"2021-06-10T04:00:18.000Z\",\"author_id\":\"2401673892\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1402837624943878149\"}],\"conversation_id\":\"1402836242761355265\"},{\"source\":\"Twitter Web App\",\"id\":\"1402837624943878149\",\"entities\":{\"urls\":[{\"start\":123,\"end\":146,\"url\":\"https://t.co/Sn6Z6Nj2fw\",\"expanded_url\":\"https://www.cdc.gov/vaccinesafety/ensuringsafety/monitoring/vsd/index.html\",\"display_url\":\"cdc.gov/vaccinesafety/…\"}],\"annotations\":[{\"start\":0,\"end\":2,\"probability\":0.5149,\"type\":\"Organization\",\"normalized_text\":\"VSD\"},{\"start\":15,\"end\":17,\"probability\":0.5334,\"type\":\"Organization\",\"normalized_text\":\"CDC\"}]},\"in_reply_to_user_id\":\"2401673892\",\"public_metrics\":{\"retweet_count\":359,\"reply_count\":1,\"like_count\":887,\"quote_count\":2},\"lang\":\"ja\",\"possibly_sensitive\":false,\"text\":\"VSDは全米9つの民間病院群とCDCの共同プロジェクトで、電子カルテと紐付けることでワクチン接種の有無と診断名を結びつけることが可能です。\\n\\nVSDの優れているところは、「ワクチン接種者と非接種者の頻度の比較」を行う疫学研究が可能なところです。\\nhttps://t.co/Sn6Z6Nj2fw\",\"created_at\":\"2021-06-10T03:58:47.000Z\",\"author_id\":\"2401673892\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1402837142745743366\"}],\"conversation_id\":\"1402836242761355265\"},{\"source\":\"Twitter Web App\",\"id\":\"1402837142745743366\",\"entities\":{\"urls\":[{\"start\":139,\"end\":162,\"url\":\"https://t.co/QFH1RWqxuV\",\"expanded_url\":\"https://www.cdc.gov/vaccinesafety/ensuringsafety/monitoring/vaers/index.html\",\"display_url\":\"cdc.gov/vaccinesafety/…\"}]},\"in_reply_to_user_id\":\"2401673892\",\"public_metrics\":{\"retweet_count\":568,\"reply_count\":7,\"like_count\":1348,\"quote_count\":7},\"lang\":\"ja\",\"possibly_sensitive\":false,\"text\":\"そもそも米国には①VAERS②VSD③CISAという3つのシステムがあり、ワクチン接種後の有害事象を評価しています。\\n\\nVAERSは有害事象報告制度。\\n\\nとにかくワクチン接種後に起きた死亡例などの報告を集め、自然発生より増えていることがないかなど、統計学的な解析もしています。\\nhttps://t.co/QFH1RWqxuV\",\"created_at\":\"2021-06-10T03:56:52.000Z\",\"author_id\":\"2401673892\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1402836242761355265\"}],\"conversation_id\":\"1402836242761355265\"},{\"attachments\":{\"media_keys\":[\"3_1401566945024131073\"]},\"source\":\"Twitter Web App\",\"id\":\"1401569131477020675\",\"entities\":{\"urls\":[{\"start\":90,\"end\":113,\"url\":\"https://t.co/dGLXOt4A8k\",\"expanded_url\":\"https://twitter.com/OgySeeker/status/1401569131477020675/photo/1\",\"display_url\":\"pic.twitter.com/dGLXOt4A8k\"}]},\"public_metrics\":{\"retweet_count\":306,\"reply_count\":193,\"like_count\":495,\"quote_count\":96},\"lang\":\"en\",\"possibly_sensitive\":false,\"text\":\"What will be the outcome of this madness? Check the  links!  There is the key of the key: https://t.co/dGLXOt4A8k\",\"created_at\":\"2021-06-06T15:58:15.000Z\",\"author_id\":\"1296053599743680513\",\"conversation_id\":\"1401569131477020675\"},{\"at